import React, { useState } from "react";
import styled from "styled-components";
import { CardDeck, Card } from "react-bootstrap";
const Cards = styled.div`
  margin: 1rem;
  flex-basis: 45%;
  padding: 1.5rem;
  text-align: left;
  color: inherit;
  text-decoration: none;
  border: 1px solid #eaeaea;
  border-radius: 10px;
  transition: color 0.15s ease, border-color 0.15s ease;
`;

const Layout = styled.div`
  min-height: 100vh;
  padding: 0 0.5rem;
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  align-items: center;
`;

const Grid = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex-wrap: wrap;
  max-width: 800px;
  margin-top: 3rem;
`;

const Main = styled.main`
  padding: 5rem 0;
  flex: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`;

  const mystyle = {
    margin: "0 0 1rem 0",
    fontSize: "1.5rem"
  };
export const Home = () => {
  return (
    <Layout>
      <Main>
        <Grid>
          <CardDeck>
            <Card>
              <Card.Title style = {mystyle}>Exterior Estimates</Card.Title>
            </Card>
            <Card>
              <Card.Title>Interior Estimates</Card.Title>
            </Card>
            <Card>
              <Card.Title>Cabinet Estimates</Card.Title>
            </Card>
            <Card>
              <Card.Title>Cash Entry</Card.Title>
            </Card>
          </CardDeck>
        </Grid>
      </Main>
    </Layout>
  );
};
